/**
 * n8n Code Node – Formatter Markdown → texte Google Docs friendly (v2)
 *
 * Entrée  : items[0].json.output  (string Markdown)
 * Sortie  : { text: "<texte mis en forme>" }
 */

const raw = items[0].json.output ?? '';
if (typeof raw !== 'string') {
	throw new Error('Le champ "output" doit être une chaîne de caractères.');
}

// ───────── 1) Décodage des \n éventuels ─────────
let text = raw.replace(/\\n/g, '\n').replace(/\\t/g, '\t');

// ───────── 2) Mise en forme des titres ─────────
text = text
	// H1  : majuscules + soulignement
	.replace(/^#\s+(.+)$/gm, (m, p1) => `\n${p1.toUpperCase()}\n${'='.repeat(p1.length)}\n`)
	// H2  : majuscules + encadrement tirets
	.replace(/^##\s+(.+)$/gm, (m, p1) => `\n${p1.toUpperCase()}\n${'-'.repeat(p1.length)}\n`)
	// H3  : majuscules simples (plus d’indentation)
	.replace(/^###\s+(.+)$/gm, (m, p1) => `\n${p1.toUpperCase()}\n`);

// ───────── 3) Puces “-” ou “*” → “• ” ─────────
text = text.replace(/^\s*[-*]\s+/gm, '• ');

// ───────── 4) Tableaux Markdown → liste “Clé : Valeur” ─────────
text = text.replace(/^\|(.+?)\|$/gm, (m, p1) => {
	// On ignore les lignes séparatrices (---|---)
	if (/^\s*[-:]+\s*(\|\s*[-:]+\s*)+$/.test(p1)) return '';
	const cols = p1.split(/\s*\|\s*/).map(s => s.trim());
	if (cols.length >= 2) {
		return `• ${cols[0]} : ${cols[1]}`;
	}
	return p1; // ligne étrange : fallback
});

// ───────── 5) Nettoyages divers ─────────
text = text
	.replace(/[ \t]+$/gm, '')      // espaces fin de ligne
	.replace(/\n{3,}/g, '\n\n');   // >2 sauts → 2

return [
	{
		json: { text },
	},
];
